import ReactDOM  from "react-dom/client";
import {createBrowserRouter, RouterProvider} from 'react-router-dom'
import App from "./App";

const routs = ReactDOM.createRoot(App)
const root = createBrowserRouter(document.getElementById('root'))
root.render(<RouterProvider routs={routs}/>)
